stylometry:
@RiskSimTable allows you to run the same simulation several times simultaneously using different input variables, it does this quickly and easiler than without running it on excel without @Risk. For example it would be used in simulating inventory quantity amounts (for example baseball glovers) and the needed orders to combate demand. You choose 5 different output quantity variables and enter them in 
=@RiskSimTable({100,150,200,250,300})
when this is ran it gives you the optimal number of basbeall gloves.
